const UserList = (props) => {
    const deleteTaskHandler = (event) => {
        event.preventDefault();
        if(enterTask.trim().length === 0 ){
            setError({
                title: 'Invalid input',
                message: 'Please enter a task to do',
            });
            return;
        }
        console.log(enterTask);
        props.onAddTask(enterTask);
        setTask('');


    };
    return(
        <div>
            <ul>
                {props.users.map((user) => (
                    <li key={user.id}>
                        {user.task}
                        <button onClick={props.deleteTask}>hehe</button>
                    </li>
                ))}

            </ul>
        </div>

    );
}
export default UserList;
